import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { Typography, CssBaseline, Button, Container } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
  }));

const Home = props => {
    const classes = useStyles();
    return (
        <Container>
        <div className={classes.root}>
        <Grid container spacing={3}>
            <Grid item xs={12}>
                <Typography variant="h4">View your personal Spotify stats.</Typography>
            </Grid>
            <Grid item xs={6}>
                <Button variant="contained" onClick={() => props.handleClick("artists")}>View Artists</Button>
            </Grid>
            <Grid item xs={6}>
                <Button variant="contained" onClick={() => props.handleClick("tracks")}>View Tracks</Button>
            </Grid>
        </Grid>
      </div>
        </Container>
    )

}
export default Home;
